import React from "react";
import { Component } from "../../components/Component";
import { Caret } from "../../icons/Caret";
import { Icon1 } from "../../icons/Icon1";
import { Icon2 } from "../../icons/Icon2";
import { Icon7 } from "../../icons/Icon7";
import image8 from "../../img/image-108.png";
import rectangle from "../../img/rectangle-9.svg";
import rectangle7 from "../../img/rectangle-7-1.png";
import fullLogo2 from '../../img/fulllogo-transparent-nobuffer-2-2.png';
import fullLogo1 from '../../img/fulllogo-transparent-nobuffer-1-1.png';
import { IconPaginationPrev1 } from "../../icons/IconPaginationPrev1";
import line from '../../img/line-89-1.svg';
import next from '../../img/icon-pagination-next.svg';

import SidePanel from '../CompareProperty/SidePanel';

// import { Component, IconPaginationPrev1, SidePanel, FAQ } from './components';

// ImageSection Component
const ImageSection = ({ rect }) => (
  <div className="relative w-full h-[637px]">
    <img className="absolute w-[140px] h-[637px] top-[81px] left-[90px]" alt="Background Rectangle" src={rectangle} />
    <img className="absolute w-[240px] h-[174px] top-0" alt="Top Rectangle" src={rect} />
  </div>
);

// RatingIndicator Component
const RatingIndicator = () => (
  <div className="absolute w-9 h-[7px] top-[159px] left-[82px] bg-[#2a2a33] rounded-full">
    <div className="flex items-center space-x-1.5 absolute top-0 left-0">
      {[...Array(5)].map((_, i) => (
        <div
          key={i}
          className={`w-${i === 0 ? '10.75' : '3.39'} h-${i === 0 ? '4.52' : '3.39'} bg-white rounded-full ${i > 0 ? 'opacity-60' : ''}`}
        />
      ))}
    </div>
  </div>
);

// PropertyDetails Component
const PropertyDetails = () => (
  <div className="absolute w-full top-[190px] left-0">
    <div className="font-bold text-black text-base"> $3,750/mo </div>
    <div className="text-[#2a2a33] text-sm mt-1"> $2.08 per sq ft </div>
    <img className="w-[126px] h-[1px] my-4" alt="Separator Line" src="/img/line-91.svg" />
    <div className="font-bold text-orange text-sm"> 1621 166th Ave NE </div>
    <div className="text-[#2a2a33] text-sm mt-1"> 0.8 miles away </div>
    <div className="flex items-center mt-4">
